function userupdateform(){var c=$("#userId_update").val();var h=$("#phone_update").val();var b=$("#phone_update").val();var g=$("#rolelist_update").combobox("getValue");var a=$("#address_update").val();var d=$("#realname_update").val();var f=$("#orgname_update").val();var e={"userId":c,"username":h,"phone":b,"roleId":g,"address":a,"realname":d,"orgname":f};console.log(e);if(b==""){$.messager.alert("提示","联系电话不能为空");return}if(d==""){$.messager.alert("提示","真实姓名不能为空");return}if(g==""){$.messager.alert("提示","角色不能为空");return}$.ajax({url:ws_url+"/rest/user/editUser?token="+gtoken,contentType:"application/json;charset=UTF-8",type:"post",datatype:"json",data:JSON.stringify(e),cache:false,success:function(i){console.log(i.status);console.log(i.message);$("#form2").form("clear");if(i.status=="success"){$.messager.alert("提示","修改成功！","info",function(){$("#userupdate").window("close");$("#usergrid").datagrid("clearSelections");$("#usergrid").datagrid("reload")})}else{if(i.status=="failure"){$.messager.alert("提示","修改失败！","error",function(){$("#userupdate").window("close");$("#usergrid").datagrid("clearSelections");$("#usergrid").datagrid("reload")})}}},error:function(i){console.log(i)}})};